function WeatherBox(props) {
    return (
        <>
        <div className='grid-item'><h1>Todays weather: Morning </h1>
        <p>Weather description: {props.weatherData.weatherDescription.time}</p>
        <p>Temperature: {props.weatherData.temperature.time} degrees C</p>
        <p>Precipitation: {props.weatherData.precipitation.time}mm</p>
        <p>Humidity: {props.weatherData.humidity.time}%</p>
        <p>Wind Speed: {props.weatherData.windSpeed.time}km/h</p></div>
        </>
    )
}

export default WeatherBox
